void key_num_control(KEY_MSG_t keymsg)
{

  if(keymsg.status == KEY_DOWN)
        {
            switch(keymsg.key)
            {
            case KEY_R:
                var_value(VAR_ADD);
                break;

            case KEY_L:
                var_value(VAR_SUB);
                break;

            case KEY_U:
                var_select(VAR_PREV);
                break;

            case KEY_D:
                var_select(VAR_NEXT);
                break;

            case KEY_B:
                var_ok();
                break;

            case KEY_A:
              val_cancel();
                break;

            default:
                break;
            }
        }
        else if(keymsg.status == KEY_HOLD)
        {
            switch(keymsg.key)
            {
            case KEY_R:
                var_value(VAR_ADD_HOLD);
                break;

            case KEY_L:
                var_value(VAR_SUB_HOLD);
                break;

            case KEY_U:
                var_select(VAR_PREV_HOLD);
                break;

            case KEY_D:
                var_select(VAR_NEXT_HOLD);
                break;

            case KEY_B:
               void_return();
                 break;
            default:
                break;
            }
        }
        else
        {
            //KEY_UP ,不进行处理
        }
}
void key_str_control(KEY_MSG_t keymsg)
{

  if(keymsg.status == KEY_DOWN)
        {
            switch(keymsg.key)
            {
            case KEY_L:
                str_select(VAR_PREV);
                break;

            case KEY_R:
                str_select(VAR_NEXT);
                break;

            case KEY_B:
                str_ok();
                break;

            case KEY_U:
         //     void_return();
                break;

            default:
                break;
            }
        }
}

